import React from 'react';
import logo from './logo.svg';
import './App.css';

export default class ProductPage extends React.Component{
    render(){
        return(
            <div>
                <div clas>
                <img src={logo} style={{width: 300},{height: 400}} alt="..." ></img>

                </div>
            </div>
        )
    }
}
